import * as React from 'react';
import { View, Text } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { AppNavigator } from './app/book/main';

export default class App extends Component {
  render() {
    return (
      <AppNavigator />
    );
  }
}
